import './Women.css'
import { useQuery, gql } from "@apollo/client";

const Query  = gql`
{
        categories: [Category],
        category(input: CategoryInput): Category,
        product(id: String!): Product,
        currencies: [Currency]
    }
  }
`;


function Women() {
  const { data, loading, error } = useQuery(Query);

  if (loading) return "Loading...";
  if (error) return <pre>{error.message}</pre>

 
  return (
    <div className="Women">
      <h1>Category Name</h1>
          <div className='boxes'>
              <div className="box">
                <ul>
                  {data.product.map((Product) => (
                    <li key={Product.id}>{Product.description}</li>
                  ))}
                </ul>
              </div>
              <div className="box">
              <h1>Store Product</h1>
                <ul>
                  {data.product.map((Product) => (
                    <li key={Product.id}>{Product.description}</li>
                  ))}
                </ul>
              </div>
              <div className="box">
              <h1>Store Product</h1>
                <ul>
                  {data.product.map((Product) => (
                    <li key={Product.id}>{Product.description}</li>
                  ))}
                </ul>
              </div>
              <div className="box">
              <h1>Store Product</h1>
                <ul>
                  {data.product.map((Product) => (
                    <li key={Product.id}>{Product.description}</li>
                  ))}
                </ul>
              </div>
        </div>
    </div>
  )
}

export default Women
